import React from "react"
class App14 extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            coname: "",
            ofgmail: "",
            lettersnumbers: "",
            clettersnumbers: ""
        }
    }
    render() {
        return (
            <div>
                <form>
                    <label>company name:</label>
                    <input type="text" placeholder="enter candidate name" /><br></br>
                    <label>offical gmail id:</label>
                    <input type="email" place holder="enter gmail" /><br></br>
                    <label>password:</label>
                    <input type="password" placeholder="enter strong password" /><br></br>
                    <label>conform password:</label>
                    <input type="password" placeholder="pease enter same password" /><br></br>

                </form>
            </div>
        )
    }


}
export default App14;
